import { useState } from "react";
import { useNavigate } from "react-router-dom";

const TreinoCadastroPage = () => {
    const navigate = useNavigate();
    const [workoutData, setWorkoutData] = useState({
        name: "",
        description: "",
        duration: "",
        trainerId: "",
        studentId: "",
    });
    const [exercises, setExercises] = useState([
        { id: "", name: "", sets: "", reps: "", weight: "" },
    ]);
    const [feedback, setFeedback] = useState(null);

    const handleInputChange = (e, index) => {
        const { name, value } = e.target;
        if (index !== undefined) {
            const updatedExercises = [...exercises];
            updatedExercises[index][name] = value;
            setExercises(updatedExercises);
        } else {
            setWorkoutData({
                ...workoutData,
                [name]: value,
            });
        }
    };

    const handleAddExercise = () => {
        setExercises([
            ...exercises,
            { id: "", name: "", sets: "", reps: "", weight: "" },
        ]);
    };

    const handleRemoveExercise = (index) => {
        const updatedExercises = [...exercises];
        updatedExercises.splice(index, 1);
        setExercises(updatedExercises);
    };

    const handleSubmit = async (e) => {
        e.preventDefault();

        const dataToSend = {
            nome: workoutData.name, // Alterado para 'nome'
            descricao: workoutData.description, // Opcional se não for utilizado no backend
            duracao: parseInt(workoutData.duration, 10),
            treinador_id: workoutData.trainerId, // Alterado para 'treinador_id'
            aluno_id: workoutData.studentId, // Alterado para 'aluno_id'
            exercicios: exercises.map((ex) => ({
                id: ex.id,
                series: parseInt(ex.sets, 10),
                repeticoes: parseInt(ex.reps, 10),
                peso: parseFloat(ex.weight),
            })),
        };

        try {
            const response = await fetch("http://localhost:5000/api/workouts", {
                method: "POST",
                headers: {
                    "Content-Type": "application/json",
                },
                body: JSON.stringify(dataToSend),
            });

            if (!response.ok) {
                const errorData = await response.json();
                setFeedback({
                    type: "danger",
                    message: `Erro: ${errorData.error || "Erro desconhecido"}`,
                });
            } else {
                setFeedback({ type: "success", message: "Treino cadastrado com sucesso!" });
                setTimeout(() => navigate("/treinos"), 1500); // Redirecionar após 1,5 segundos
            }
        } catch (error) {
            setFeedback({ type: "danger", message: "Erro ao enviar dados" });
        }
    };

    return (
        <div>
            <h1>Cadastrar Treino</h1>
            {feedback && (
                <div className={`alert alert-${feedback.type}`} role="alert">
                    {feedback.message}
                </div>
            )}
            <form onSubmit={handleSubmit}>
                <div>
                    <label>Nome do Treino:</label>
                    <input
                        type="text"
                        name="name"
                        value={workoutData.name}
                        onChange={(e) => handleInputChange(e)}
                        required
                    />
                </div>
                <div>
                    <label>Descrição:</label>
                    <textarea
                        name="description"
                        value={workoutData.description}
                        onChange={(e) => handleInputChange(e)}
                    />
                </div>
                <div>
                    <label>Duração (em minutos):</label>
                    <input
                        type="number"
                        name="duration"
                        value={workoutData.duration}
                        onChange={(e) => handleInputChange(e)}
                        required
                    />
                </div>
                <div>
                    <label>Treinador ID:</label>
                    <input
                        type="text"
                        name="trainerId"
                        value={workoutData.trainerId}
                        onChange={(e) => handleInputChange(e)}
                        required
                    />
                </div>
                <div>
                    <label>Aluno ID:</label>
                    <input
                        type="text"
                        name="studentId"
                        value={workoutData.studentId}
                        onChange={(e) => handleInputChange(e)}
                        required
                    />
                </div>
                <div>
                    <h3>Exercícios</h3>
                    {exercises.map((exercise, index) => (
                        <div key={index}>
                            <input
                                type="text"
                                name="name"
                                placeholder="Nome do exercício"
                                value={exercise.name}
                                onChange={(e) => handleInputChange(e, index)}
                            />
                            <input
                                type="number"
                                name="sets"
                                placeholder="Séries"
                                value={exercise.sets}
                                onChange={(e) => handleInputChange(e, index)}
                            />
                            <input
                                type="number"
                                name="reps"
                                placeholder="Repetições"
                                value={exercise.reps}
                                onChange={(e) => handleInputChange(e, index)}
                            />
                            <input
                                type="number"
                                name="weight"
                                placeholder="Peso"
                                value={exercise.weight}
                                onChange={(e) => handleInputChange(e, index)}
                            />
                            <button type="button" onClick={() => handleRemoveExercise(index)}>
                                Remover exercício
                            </button>
                        </div>
                    ))}
                    <button type="button" onClick={handleAddExercise}>
                        Adicionar exercício
                    </button>
                </div>
                <button type="submit">Salvar Treino</button>
            </form>
        </div>
    );
};

export default TreinoCadastroPage;
